import './Page.css'
import Button from '@material-ui/core/Button'
import React from 'react';
import Avatar from '@material-ui/core/Avatar'
import image from './elon.jpg'
 const  Page = ({name}) => {
        return (
        <div className='page'>
        <div className='avatar'>
          <Avatar 
            alt="elon" 
            src={image} 
                     />
        </div>
        <div className='name'>
           <p>{name}</p>
         </div>
           <div className='button'>
                <Button
                variant='outlined'
                >connect to page</Button>
           </div>
        </div>
    );
   }

   export default Page;
